  false,\n\t\"url\": null,\n\t\"notes\": \"This document is the completed effort of
  the U.S. Fish and Wildlife Service, Wilderness Fellows program to develop a monitoring
  strategy and evaluate the status of the Wichita Mountains National Wildlife Refuge
  Wilderness. This document gives context to the status of the Wichita Mountains wilderness
  and identifies the major management challenges associated with maintaining wilderness
  character. This document is intended to be a reference source for readers interested
  in understanding the wilderness and to detail the natural and anthropogenic impacts
  that threaten the state of wilderness character. The Wichita Mountains Wilderness
  Character Monitoring Plan was developed using distinct measures that assess the
  following: untrammeled quality, natural quality, undeveloped quality, and solitude
  or primitive and unconfined recreation quality.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
